// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";

contract GreenFiBorrow is Initializable, UUPSUpgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    using SafeERC20 for IERC20;

    IERC20 public weedlToken;
    uint256 public constant FEE_BASIS_POINTS = 42; // 0.420% fee (42 basis points)

    struct Borrowing {
        string id;
        address borrower;
        string landId;
        uint256 amount;
        uint256 fee;
        uint256 duration;
        uint256 startTime;
        bool isActive;
        string contactInfo;
        string purpose;
        string collateralInfo;
        string latitude;
        string longitude;
        uint256 totalLent;
        uint256 totalRepaid;
        address[] lenders; // Array to track lender addresses
        mapping(address => uint256) lenderContributions; // Tracks lender contributions
    }

    mapping(string => Borrowing) public borrowings;
    string[] public borrowingIds;
    mapping(address => string[]) public userBorrowings;

    event BorrowingCreated(
        string id,
        address indexed borrower,
        string landId,
        uint256 amount,
        uint256 fee,
        uint256 duration,
        string contactInfo,
        string purpose,
        string collateralInfo,
        string latitude,
        string longitude
    );
    event BorrowingEnded(string id, address indexed borrower);
    event LentToBorrowing(string id, address indexed lender, uint256 amount);
    event RepaidBorrowing(string id, address indexed borrower, uint256 amount);

    function initialize(address _weedlToken) public initializer {
        __Ownable_init(msg.sender);
        __UUPSUpgradeable_init();
        __ReentrancyGuard_init();
        weedlToken = IERC20(_weedlToken);
    }

    function calculateFee(uint256 _amount) public pure returns (uint256) {
        return (_amount * FEE_BASIS_POINTS) / 10000; // Fee = amount * 0.0042
    }

    function createBorrowing(
        string memory _id,
        string memory _landId,
        uint256 _amount,
        uint256 _duration,
        string memory _contactInfo,
        string memory _purpose,
        string memory _collateralInfo,
        string memory _latitude,
        string memory _longitude
    ) external nonReentrant {
        require(_amount > 0, "Amount must be greater than 0");
        require(_duration > 0 && _duration <= 365 days, "Duration must be between 1 and 365 days");
        require(bytes(_id).length > 0, "Borrowing ID cannot be empty");
        require(borrowings[_id].borrower == address(0), "Borrowing ID already exists");

        uint256 fee = calculateFee(_amount);
        weedlToken.safeTransferFrom(msg.sender, address(this), _amount + fee);

        _storeBorrowing(_id, _landId, _amount, _duration, _contactInfo, fee, _purpose, _collateralInfo, _latitude, _longitude);

        emit BorrowingCreated(
            _id,
            msg.sender,
            _landId,
            _amount,
            fee,
            _duration,
            _contactInfo,
            _purpose,
            _collateralInfo,
            _latitude,
            _longitude
        );
    }

    function _storeBorrowing(
        string memory _id,
        string memory _landId,
        uint256 _amount,
        uint256 _duration,
        string memory _contactInfo,
        uint256 _fee,
        string memory _purpose,
        string memory _collateralInfo,
        string memory _latitude,
        string memory _longitude
    ) private {
        Borrowing storage borrowing = borrowings[_id];
        borrowing.id = _id;
        borrowing.borrower = msg.sender;
        borrowing.landId = _landId;
        borrowing.amount = _amount;
        borrowing.fee = _fee;
        borrowing.duration = _duration;
        borrowing.startTime = block.timestamp;
        borrowing.isActive = true;
        borrowing.contactInfo = _contactInfo;
        borrowing.purpose = _purpose;
        borrowing.collateralInfo = _collateralInfo;
        borrowing.latitude = _latitude;
        borrowing.longitude = _longitude;
        borrowing.totalLent = 0;
        borrowing.totalRepaid = 0;

        borrowingIds.push(_id);
        userBorrowings[msg.sender].push(_id);
    }

    function lendToBorrowing(string memory _id, uint256 _amount) external nonReentrant {
        Borrowing storage borrowing = borrowings[_id];
        require(borrowing.isActive, "Borrowing is not active");
        require(_amount > 0, "Lend amount must be greater than 0");
        require(block.timestamp <= borrowing.startTime + borrowing.duration, "Borrowing duration has expired");
        require(borrowing.totalLent + _amount <= borrowing.amount, "Lending exceeds requested amount");

        weedlToken.safeTransferFrom(msg.sender, address(this), _amount);
        if (borrowing.lenderContributions[msg.sender] == 0) {
            borrowing.lenders.push(msg.sender); // Add new lender to the array
        }
        borrowing.lenderContributions[msg.sender] += _amount;
        borrowing.totalLent += _amount;

        // Transfer lent amount to borrower (excluding fee, which remains in contract)
        weedlToken.safeTransfer(borrowing.borrower, _amount);

        emit LentToBorrowing(_id, msg.sender, _amount);
    }

    function repayBorrowing(string memory _id, uint256 _amount) external nonReentrant {
        Borrowing storage borrowing = borrowings[_id];
        require(borrowing.borrower == msg.sender, "Only borrower can repay");
        require(borrowing.isActive, "Borrowing is not active");
        require(_amount > 0, "Repay amount must be greater than 0");
        require(borrowing.totalRepaid + _amount <= borrowing.totalLent, "Repayment exceeds lent amount");

        weedlToken.safeTransferFrom(msg.sender, address(this), _amount);
        borrowing.totalRepaid += _amount;

        // Distribute repayment to lenders proportionally
        for (uint256 i = 0; i < borrowing.lenders.length; i++) {
            address lender = borrowing.lenders[i];
            if (lender != address(0) && borrowing.lenderContributions[lender] > 0) {
                uint256 lenderShare = (borrowing.lenderContributions[lender] * _amount) / borrowing.totalLent;
                if (lenderShare > 0) {
                    weedlToken.safeTransfer(lender, lenderShare);
                    borrowing.lenderContributions[lender] -= lenderShare;
                }
            }
        }

        emit RepaidBorrowing(_id, msg.sender, _amount);

        // End borrowing if fully repaid
        if (borrowing.totalRepaid >= borrowing.totalLent) {
            borrowing.isActive = false;
            emit BorrowingEnded(_id, msg.sender);
        }
    }

    function endBorrowing(string memory _id) external nonReentrant {
        Borrowing storage borrowing = borrowings[_id];
        require(borrowing.borrower == msg.sender, "Only borrower can end borrowing");
        require(borrowing.isActive, "Borrowing is not active");

        borrowing.isActive = false;

        // Refund remaining un-lent amount to borrower (excluding fee)
        if (borrowing.amount > borrowing.totalLent) {
            uint256 refundAmount = borrowing.amount - borrowing.totalLent;
            weedlToken.safeTransfer(msg.sender, refundAmount);
        }

        emit BorrowingEnded(_id, msg.sender);
    }

    // Struct without mapping for external return
    struct BorrowingInfo {
        string id;
        address borrower;
        string landId;
        uint256 amount;
        uint256 fee;
        uint256 duration;
        uint256 startTime;
        bool isActive;
        string contactInfo;
        string purpose;
        string collateralInfo;
        string latitude;
        string longitude;
        uint256 totalLent;
        uint256 totalRepaid;
    }

    function getAllBorrowings() external view returns (BorrowingInfo[] memory) {
        BorrowingInfo[] memory activeBorrowings = new BorrowingInfo[](borrowingIds.length);
        uint256 count = 0;
        for (uint256 i = 0; i < borrowingIds.length; i++) {
            if (borrowings[borrowingIds[i]].isActive) {
                Borrowing storage borrowing = borrowings[borrowingIds[i]];
                activeBorrowings[count] = BorrowingInfo({
                    id: borrowing.id,
                    borrower: borrowing.borrower,
                    landId: borrowing.landId,
                    amount: borrowing.amount,
                    fee: borrowing.fee,
                    duration: borrowing.duration,
                    startTime: borrowing.startTime,
                    isActive: borrowing.isActive,
                    contactInfo: borrowing.contactInfo,
                    purpose: borrowing.purpose,
                    collateralInfo: borrowing.collateralInfo,
                    latitude: borrowing.latitude,
                    longitude: borrowing.longitude,
                    totalLent: borrowing.totalLent,
                    totalRepaid: borrowing.totalRepaid
                });
                count++;
            }
        }
        // Resize array to remove empty slots
        BorrowingInfo[] memory result = new BorrowingInfo[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = activeBorrowings[i];
        }
        return result;
    }

    function getUserBorrowings(address _user) external view returns (BorrowingInfo[] memory) {
        string[] memory userIds = userBorrowings[_user];
        BorrowingInfo[] memory userBorrowingsList = new BorrowingInfo[](userIds.length);
        uint256 count = 0;
        for (uint256 i = 0; i < userIds.length; i++) {
            if (borrowings[userIds[i]].isActive) {
                Borrowing storage borrowing = borrowings[userIds[i]];
                userBorrowingsList[count] = BorrowingInfo({
                    id: borrowing.id,
                    borrower: borrowing.borrower,
                    landId: borrowing.landId,
                    amount: borrowing.amount,
                    fee: borrowing.fee,
                    duration: borrowing.duration,
                    startTime: borrowing.startTime,
                    isActive: borrowing.isActive,
                    contactInfo: borrowing.contactInfo,
                    purpose: borrowing.purpose,
                    collateralInfo: borrowing.collateralInfo,
                    latitude: borrowing.latitude,
                    longitude: borrowing.longitude,
                    totalLent: borrowing.totalLent,
                    totalRepaid: borrowing.totalRepaid
                });
                count++;
            }
        }
        BorrowingInfo[] memory result = new BorrowingInfo[](count);
        for (uint256 i = 0; i < count; i++) {
            result[i] = userBorrowingsList[i];
        }
        return result;
    }

    function getLenderContribution(string memory _id, address _lender) external view returns (uint256) {
        return borrowings[_id].lenderContributions[_lender];
    }

    function getLenders(string memory _id) external view returns (address[] memory) {
        return borrowings[_id].lenders;
    }

    // Required for UUPS upgradeability
    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}
}

contracts/GreenFiLand.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";

contract GreenFiLand is Initializable, UUPSUpgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    using SafeERC20 for IERC20;

    IERC20 public weedlToken;
    uint256 public constant FEE_BASIS_POINTS = 42; // 0.420% fee (42 basis points)
    uint256 public constant MAX_CONTACT_LENGTH = 100; // Max length for contact info
    uint256 public constant MAX_PAGE_SIZE = 50; // Max listings per page

    struct LandListing {
        string id;
        address owner;
        string metadataURI; // IPFS URI for metadata (image, description, coordinates, etc.)
        uint256 collateralValue; // In WEEDL tokens (in wei)
        bool isActive;
        string loanId; // For future loan integration
        string borrowId; // For future borrow integration
        string contactInfo; // Contact info (email or website)
    }

    mapping(string => LandListing) public landListings;
    string[] public landIds;
    mapping(string => uint256) public landIdIndices;

    event LandListed(
        string indexed id,
        address indexed owner,
        string metadataURI,
        uint256 collateralValue,
        string contactInfo
    );
    event LandCollateralUpdated(string indexed id, uint256 newCollateralValue);
    event LandDelisted(string indexed id, address indexed owner);
    event FeeTransferred(address indexed from, address indexed to, uint256 amount);

    error InvalidCollateralValue();
    error LandInUse();
    error Unauthorized();
    error LandNotActive();
    error LandHasActiveLoan();
    error InvalidContactInfo();
    error InvalidTokenAddress();
    error InvalidLandId();
    error InsufficientBalance();
    error InvalidPaginationParameters();

    function initialize(address _weedlToken) public initializer {
        if (_weedlToken == address(0)) revert InvalidTokenAddress();
        if (_weedlToken.code.length == 0) revert InvalidTokenAddress();
        __Ownable_init(msg.sender);
        __UUPSUpgradeable_init();
        __ReentrancyGuard_init();
        weedlToken = IERC20(_weedlToken);
    }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    function listLand(
        string memory _id,
        string memory _metadataURI,
        uint256 _collateralValue,
        string memory _contactInfo
    ) external nonReentrant {
        if (bytes(_id).length == 0) revert InvalidLandId();
        if (_collateralValue == 0) revert InvalidCollateralValue();
        if (bytes(landListings[_id].id).length != 0) revert LandInUse();
        if (bytes(_contactInfo).length > MAX_CONTACT_LENGTH) revert InvalidContactInfo();
        if (bytes(_metadataURI).length == 0) revert InvalidContactInfo();

        // Calculate single 0.420% fee
        uint256 fee = (_collateralValue * FEE_BASIS_POINTS) / 10000;
        uint256 totalRequired = _collateralValue + fee;

        // Check balance
        if (weedlToken.balanceOf(msg.sender) < totalRequired) revert InsufficientBalance();

        // Transfer tokens
        weedlToken.safeTransferFrom(msg.sender, address(this), totalRequired);
        emit FeeTransferred(msg.sender, address(this), fee);

        // Store listing
        landListings[_id] = LandListing({
            id: _id,
            owner: msg.sender,
            metadataURI: _metadataURI,
            collateralValue: _collateralValue,
            isActive: true,
            loanId: "",
            borrowId: "",
            contactInfo: _contactInfo
        });

        landIdIndices[_id] = landIds.length;
        landIds.push(_id);

        emit LandListed(_id, msg.sender, _metadataURI, _collateralValue, _contactInfo);
    }

    function updateLandCollateral(string memory _id, uint256 _newCollateralValue) external nonReentrant {
        LandListing storage listing = landListings[_id];
        if (!listing.isActive) revert LandNotActive();
        if (listing.owner != msg.sender) revert Unauthorized();
        if (_newCollateralValue == 0) revert InvalidCollateralValue();

        uint256 oldCollateral = listing.collateralValue;
        uint256 oldFee = (oldCollateral * FEE_BASIS_POINTS) / 10000;
        uint256 oldTotal = oldCollateral + oldFee;

        uint256 newFee = (_newCollateralValue * FEE_BASIS_POINTS) / 10000;
        uint256 newTotal = _newCollateralValue + newFee;

        if (newTotal > oldTotal) {
            // Transfer additional tokens
            weedlToken.safeTransferFrom(msg.sender, address(this), newTotal - oldTotal);
            emit FeeTransferred(msg.sender, address(this), newTotal - oldTotal);
        } else if (newTotal < oldTotal) {
            // Refund excess tokens
            weedlToken.safeTransfer(msg.sender, oldTotal - newTotal);
            emit FeeTransferred(address(this), msg.sender, oldTotal - newTotal);
        }

        listing.collateralValue = _newCollateralValue;
        emit LandCollateralUpdated(_id, _newCollateralValue);
    }

    function delistLand(string memory _id) external nonReentrant {
        LandListing storage listing = landListings[_id];
        if (!listing.isActive) revert LandNotActive();
        if (listing.owner != msg.sender) revert Unauthorized();
        if (bytes(listing.loanId).length != 0 || bytes(listing.borrowId).length != 0) revert LandHasActiveLoan();

        uint256 collateral = listing.collateralValue;
        uint256 fee = (collateral * FEE_BASIS_POINTS) / 10000;
        uint256 totalRefund = collateral + fee;

        listing.isActive = false;

        // Remove from landIds array
        uint256 index = landIdIndices[_id];
        if (index < landIds.length) {
            landIds[index] = landIds[landIds.length - 1];
            landIdIndices[landIds[index]] = index;
            landIds.pop();
            delete landIdIndices[_id];
        }

        // Refund tokens
        weedlToken.safeTransfer(msg.sender, totalRefund);
        emit FeeTransferred(address(this), msg.sender, totalRefund);

        emit LandDelisted(_id, msg.sender);
    }

    function getAllLandListingsPaginated(uint256 startIndex, uint256 pageSize)
        external
        view
        returns (LandListing[] memory, uint256 totalActive)
    {
        if (pageSize == 0 || pageSize > MAX_PAGE_SIZE) revert InvalidPaginationParameters();
        if (startIndex >= landIds.length) revert InvalidPaginationParameters();

        // Count total active listings
        uint256 activeCount = 0;
        for (uint256 i = 0; i < landIds.length; i++) {
            if (landListings[landIds[i]].isActive) {
                activeCount++;
            }
        }

        // Determine size of result array
        uint256 remaining = activeCount > startIndex ? activeCount - startIndex : 0;
        uint256 resultSize = remaining < pageSize ? remaining : pageSize;
        LandListing[] memory result = new LandListing[](resultSize);

        // Collect listings
        uint256 count = 0;
        for (uint256 i = startIndex; i < landIds.length && count < pageSize; i++) {
            if (landListings[landIds[i]].isActive) {
                result[count] = landListings[landIds[i]];
                count++;
            }
        }

        return (result, activeCount);
    }

    function getUserListingsPaginated(address _owner, uint256 startIndex, uint256 pageSize)
        external
        view
        returns (LandListing[] memory, uint256 totalUserActive)
    {
        if (pageSize == 0 || pageSize > MAX_PAGE_SIZE) revert InvalidPaginationParameters();
        if (startIndex >= landIds.length) revert InvalidPaginationParameters();

        // Count total active listings for the user
        uint256 userListingCount = 0;
        for (uint256 i = 0; i < landIds.length; i++) {
            if (landListings[landIds[i]].isActive && landListings[landIds[i]].owner == _owner) {
                userListingCount++;
            }
        }

        // Determine size of result array
        uint256 remaining = userListingCount > startIndex ? userListingCount - startIndex : 0;
        uint256 resultSize = remaining < pageSize ? remaining : pageSize;
        LandListing[] memory result = new LandListing[](resultSize);

        // Collect listings
        uint256 count = 0;
        for (uint256 i = startIndex; i < landIds.length && count < pageSize; i++) {
            if (landListings[landIds[i]].isActive && landListings[landIds[i]].owner == _owner) {
                result[count] = landListings[landIds[i]];
                count++;
            }
        }

        return (result, userListingCount);
    }

    function getLandListing(string memory _id) external view returns (LandListing memory) {
        return landListings[_id];
    }

    function getTotalActiveListings() external view returns (uint256) {
        uint256 activeCount = 0;
        for (uint256 i = 0; i < landIds.length; i++) {
            if (landListings[landIds[i]].isActive) {
                activeCount++;
            }
        }
        return activeCount;
    }
}

contracts/GreenFiLoan.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";

contract GreenFiLoan is Initializable, UUPSUpgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    using SafeERC20 for IERC20;

    IERC20 public weedlToken;
    uint256 public constant FEE_BASIS_POINTS = 42; // 0.420% fee (42 basis points)
    uint256 public constant INTEREST_RATE_BASIS_POINTS = 420; // 4.20% interest rate (420 basis points)
    uint256 public constant MAX_LOAN_DURATION = 365 days; // 365 days

    struct LoanInu {
        string id;
        address borrower;
        string landId;
        uint256 amount;
        uint256 duration;
        bool isActive;
        string contactInfo;
        uint256 fee;
        uint256 createdAt;
        string purpose;
        string status;
        string collateralDetails;
        string latitude;
        string longitude;
        address lender;
        uint256 repaidAmount;
    }

    mapping(string => LoanInu) public loans;
    string[] public loanIds;
    mapping(address => string[]) public borrowerLoans;
    mapping(address => uint256) public borrowerLoanCount;
    mapping(address => uint256) public borrowerRepaidCount;
    mapping(string => uint256) public repaymentStatus;

    event LoanCreated(
        string id,
        address indexed borrower,
        string landId,
        uint256 amount,
        uint256 duration,
        string contactInfo,
        uint256 fee,
        string purpose,
        string collateralDetails,
        string latitude,
        string longitude
    );
    event LoanFunded(string id, address indexed lender, address indexed borrower);
    event LoanRepaid(string id, address indexed borrower, uint256 amount, uint256 interest);
    event LoanClosed(string id, address indexed borrower);
    event LoanCanceled(string id, address indexed borrower);
    event CollateralClaimed(string id, address indexed lender);
    event LoanStatusChanged(string id, string status);

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(address _weedlToken) public initializer {
        __Ownable_init(msg.sender);
        __UUPSUpgradeable_init();
        __ReentrancyGuard_init();
        require(_weedlToken != address(0), "Invalid WEEDL token address");
        weedlToken = IERC20(_weedlToken);
    }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    function createLoan(
        string memory _id,
        string memory _landId,
        uint256 _amount,
        uint256 _duration,
        string memory _contactInfo,
        uint256 _fee,
        string memory _purpose,
        string memory _collateralDetails,
        string memory _latitude,
        string memory _longitude
    ) external nonReentrant {
        require(_amount > 0, "Amount must be greater than zero");
        require(_duration > 0 && _duration <= MAX_LOAN_DURATION, "Duration must be 1 to 365 days");
        require(bytes(_id).length > 0, "Loan ID cannot be empty");
        require(bytes(_contactInfo).length > 0, "Contact info required");
        require(bytes(_purpose).length > 0, "Purpose required");
        require(loans[_id].amount == 0, "Loan ID already exists");
        require(_fee == (_amount * FEE_BASIS_POINTS) / 10000, "Invalid fee");
        require(weedlToken.balanceOf(msg.sender) >= _amount + _fee, "Insufficient WEEDL balance");

        // Transfer tokens
        weedlToken.safeTransferFrom(msg.sender, address(this), _amount + _fee);

        // Create and store loan
        _storeLoan(
            _id,
            _landId,
            _amount,
            _duration,
            _contactInfo,
            _fee,
            _purpose,
            _collateralDetails,
            _latitude,
            _longitude
        );

        borrowerLoanCount[msg.sender]++;

        emit LoanCreated(
            _id,
            msg.sender,
            _landId,
            _amount,
            _duration,
            _contactInfo,
            _fee,
            _purpose,
            _collateralDetails,
            _latitude,
            _longitude
        );
        emit LoanStatusChanged(_id, "Open");
    }

    function _storeLoan(
        string memory _id,
        string memory _landId,
        uint256 _amount,
        uint256 _duration,
        string memory _contactInfo,
        uint256 _fee,
        string memory _purpose,
        string memory _collateralDetails,
        string memory _latitude,
        string memory _longitude
    ) private {
        loans[_id] = LoanInu({
            id: _id,
            borrower: msg.sender,
            landId: _landId,
            amount: _amount,
            duration: _duration,
            isActive: true,
            contactInfo: _contactInfo,
            fee: _fee,
            createdAt: block.timestamp,
            purpose: _purpose,
            status: "Open",
            collateralDetails: _collateralDetails,
            latitude: _latitude,
            longitude: _longitude,
            lender: address(0),
            repaidAmount: 0
        });

        loanIds.push(_id);
        borrowerLoans[msg.sender].push(_id);
    }

    function fundLoan(string memory _id) external nonReentrant {
        LoanInu storage loan = loans[_id];
        require(loan.isActive, "Loan is not active");
        require(keccak256(abi.encodePacked(loan.status)) == keccak256(abi.encodePacked("Open")), "Loan not open");
        require(weedlToken.balanceOf(msg.sender) >= loan.amount, "Insufficient WEEDL balance");

        loan.status = "Funded";
        loan.lender = msg.sender;
        weedlToken.safeTransferFrom(msg.sender, loan.borrower, loan.amount);

        emit LoanFunded(_id, msg.sender, loan.borrower);
        emit LoanStatusChanged(_id, "Funded");
    }

    function repayLoan(string memory _id) external nonReentrant {
        LoanInu storage loan = loans[_id];
        require(loan.isActive, "Loan is not active");
        require(loan.borrower == msg.sender, "Only borrower can repay");
        require(keccak256(abi.encodePacked(loan.status)) == keccak256(abi.encodePacked("Funded")), "Loan not funded");

        // Calculate simple interest: interest = principal * rate * time
        uint256 interest = (loan.amount * INTEREST_RATE_BASIS_POINTS * loan.duration) / (10000 * 365 days);
        uint256 totalRepayment = loan.amount + interest;
        require(weedlToken.balanceOf(msg.sender) >= totalRepayment, "Insufficient WEEDL balance");

        // Transfer principal + interest to lender
        weedlToken.safeTransferFrom(msg.sender, loan.lender, totalRepayment);
        loan.repaidAmount = totalRepayment;
        repaymentStatus[_id] = totalRepayment;

        loan.status = "Repaid";
        loan.isActive = false;
        borrowerRepaidCount[msg.sender]++;

        emit LoanRepaid(_id, msg.sender, loan.amount, interest);
        emit LoanStatusChanged(_id, "Repaid");
    }

    function cancelLoan(string memory _id) external nonReentrant {
        LoanInu storage loan = loans[_id];
        require(loan.isActive, "Loan is not active");
        require(loan.borrower == msg.sender, "Only borrower can cancel");
        require(keccak256(abi.encodePacked(loan.status)) == keccak256(abi.encodePacked("Open")), "Loan not open");
        require(weedlToken.balanceOf(address(this)) >= loan.amount + loan.fee, "Insufficient contract balance");

        loan.status = "Canceled";
        loan.isActive = false;

        uint256 totalAmount = loan.amount + loan.fee;
        weedlToken.safeTransfer(msg.sender, totalAmount);

        emit LoanCanceled(_id, msg.sender);
        emit LoanStatusChanged(_id, "Canceled");
    }

    function claimCollateral(string memory _id) external nonReentrant {
        LoanInu storage loan = loans[_id];
        require(loan.isActive, "Loan is not active");
        require(loan.lender == msg.sender, "Only lender can claim collateral");
        require(keccak256(abi.encodePacked(loan.status)) == keccak256(abi.encodePacked("Funded")), "Loan not funded");
        require(block.timestamp > loan.createdAt + loan.duration, "Loan duration not expired");
        require(bytes(loan.collateralDetails).length > 0, "No collateral to claim");

        loan.status = "Defaulted";
        loan.isActive = false;

        // In a real implementation, this would interact with a collateral management system
        // For now, we emit an event and update status
        emit CollateralClaimed(_id, msg.sender);
        emit LoanStatusChanged(_id, "Defaulted");
    }

    function getAllLoans() external view returns (LoanInu[] memory) {
        LoanInu[] memory allLoans = new LoanInu[](loanIds.length);
        for (uint256 i = 0; i < loanIds.length; i++) {
            allLoans[i] = loans[loanIds[i]];
        }
        return allLoans;
    }

    function getBorrowerLoans(address _borrower) external view returns (LoanInu[] memory) {
        string[] memory borrowerLoanIds = borrowerLoans[_borrower];
        LoanInu[] memory borrowerLoanList = new LoanInu[](borrowerLoanIds.length);
        for (uint256 i = 0; i < borrowerLoanIds.length; i++) {
            borrowerLoanList[i] = loans[borrowerLoanIds[i]];
        }
        return borrowerLoanList;
    }

    function getBorrowerHistory(address _borrower) external view returns (uint256, uint256) {
        return (borrowerLoanCount[_borrower], borrowerRepaidCount[_borrower]);
    }

    function getRepaymentStatus(string memory _id) external view returns (uint256) {
        return repaymentStatus[_id];
    }
}

