// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";

contract GreenFiSeed is Initializable, UUPSUpgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    using SafeERC20 for IERC20;

    IERC20 public weedlToken;
    uint256 public constant FEE_BASIS_POINTS = 42; // 0.420% fee (42 basis points)

    struct Seed {
        string id;
        address seller;
        string ipfsHash;
        string strain;
        uint256 price;
        string contactInfo;
        uint256 quantity;
        uint256 discount;
        bool isActive;
    }

    mapping(string => Seed) public seeds;
    string[] public seedIds;
    mapping(address => string[]) public sellerSeeds;

    event SeedListed(
        string indexed seedId,
        address indexed seller,
        string ipfsHash,
        string strain,
        uint256 price,
        string contactInfo,
        uint256 quantity,
        uint256 discount,
        uint256 fee
    );
    event SeedPurchased(string indexed seedId, address indexed buyer, uint256 quantity, uint256 totalPrice);
    event SeedDelisted(string indexed seedId, address indexed seller);
    event FeeCollected(address indexed payer, uint256 feeAmount);

    /// @custom:oz-upgrades-unsafe-allow constructor
    constructor() {
        _disableInitializers();
    }

    function initialize(address _weedlToken) external initializer {
        __Ownable_init(msg.sender);
        __UUPSUpgradeable_init();
        __ReentrancyGuard_init();
        require(_weedlToken != address(0), "Zero token address");
        weedlToken = IERC20(_weedlToken);
    }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    function listSeed(
        string memory _seedId,
        string memory _ipfsHash,
        uint256 _price,
        string memory _contactInfo,
        string memory _strain,
        uint256 _quantity,
        uint256 _discount
    ) external nonReentrant {
        require(bytes(_seedId).length > 0 && bytes(_seedId).length <= 32, "Invalid seed ID");
        require(seeds[_seedId].seller == address(0), "SeedIdInUse");
        require(_price > 0, "InvalidPrice");
        require(_quantity > 0 && _quantity <= 1000, "InvalidQuantity");
        require(_discount <= 50, "InvalidDiscount");
        require(bytes(_contactInfo).length <= 100, "ContactInfoTooLong");
        require(bytes(_strain).length > 0, "InvalidStrain");
        require(bytes(_ipfsHash).length > 0, "InvalidIPFSHash");

        // Calculate one-time 0.420% fee on the listing price
        uint256 fee = (_price * FEE_BASIS_POINTS) / 10000;

        // Transfer only the fee from the seller to the contract
        weedlToken.safeTransferFrom(msg.sender, address(this), fee);

        Seed memory newSeed = Seed({
            id: _seedId,
            seller: msg.sender,
            ipfsHash: _ipfsHash,
            strain: _strain,
            price: _price,
            contactInfo: _contactInfo,
            quantity: _quantity,
            discount: _discount,
            isActive: true
        });

        seeds[_seedId] = newSeed;
        seedIds.push(_seedId);
        sellerSeeds[msg.sender].push(_seedId);

        emit SeedListed(_seedId, msg.sender, _ipfsHash, _strain, _price, _contactInfo, _quantity, _discount, fee);
        emit FeeCollected(msg.sender, fee);
    }

    function purchaseSeed(string memory _seedId, uint256 _quantity) external nonReentrant {
        Seed storage seed = seeds[_seedId];
        require(seed.isActive, "SeedNotActive");
        require(_quantity > 0, "InvalidPurchaseQuantity");
        require(seed.quantity >= _quantity, "InsufficientQuantity");
        require(seed.seller != msg.sender, "CannotBuyOwnSeed");

        uint256 price = seed.price;
        if (seed.discount > 0) {
            price = (price * (100 - seed.discount)) / 100;
        }

        uint256 totalPrice = price * _quantity;
        uint256 fee = (totalPrice * FEE_BASIS_POINTS) / 10000;
        uint256 amountToSeller = totalPrice - fee;

        weedlToken.safeTransferFrom(msg.sender, seed.seller, amountToSeller);
        weedlToken.safeTransferFrom(msg.sender, address(this), fee);

        seed.quantity -= _quantity;
        if (seed.quantity == 0) {
            seed.isActive = false;
        }

        emit SeedPurchased(_seedId, msg.sender, _quantity, totalPrice);
        emit FeeCollected(msg.sender, fee);
    }

    function delistSeed(string memory _seedId) external nonReentrant {
        Seed storage seed = seeds[_seedId];
        require(seed.seller == msg.sender, "NotSeedSeller");
        require(seed.isActive, "SeedNotActive");

        // No reimbursement since no upfront payment was made beyond the listing fee
        seed.isActive = false;

        emit SeedDelisted(_seedId, msg.sender);
    }

    function getAllSeeds() external view returns (Seed[] memory) {
        Seed[] memory activeSeeds = new Seed[](seedIds.length);
        uint256 activeCount = 0;

        for (uint256 i = 0; i < seedIds.length; i++) {
            if (seeds[seedIds[i]].isActive) {
                activeSeeds[activeCount] = seeds[seedIds[i]];
                activeCount++;
            }
        }

        // Resize array to remove empty slots
        Seed[] memory result = new Seed[](activeCount);
        for (uint256 i = 0; i < activeCount; i++) {
            result[i] = activeSeeds[i];
        }

        return result;
    }

    function getSellerSeeds(address _seller) external view returns (Seed[] memory) {
        string[] memory sellerSeedIds = sellerSeeds[_seller];
        Seed[] memory result = new Seed[](sellerSeedIds.length);
        for (uint256 i = 0; i < sellerSeedIds.length; i++) {
            result[i] = seeds[sellerSeedIds[i]];
        }
        return result;
    }

    function withdrawFees() external onlyOwner nonReentrant {
        uint256 balance = weedlToken.balanceOf(address(this));
        require(balance > 0, "NoFeesToWithdraw");
        weedlToken.safeTransfer(owner(), balance);
    }
}

