// SPDX-License-Identifier: MIT
pragma solidity ^0.8.22;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";

contract GreenFiStaking is Initializable, UUPSUpgradeable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    using SafeERC20 for IERC20;

    IERC20 public weedlToken;
    uint256 public constant FEE_BASIS_POINTS = 42; // 0.420% fee (42 basis points)
    uint256 public constant REWARD_RATE = 420; // 4.20% APY (in basis points)
    uint256 public constant SECONDS_PER_YEAR = 365 * 24 * 60 * 60; // Seconds in a year

    struct Stake {
        address user;
        uint256 amount;
        uint256 startTime;
        uint256 duration;
        uint256 rewardDebt;
        bool isActive;
    }

    mapping(address => Stake[]) private userStakes;
    uint256 private totalStaked;

    event Staked(address indexed user, uint256 amount, uint256 duration, uint256 startTime);
    event Unstaked(address indexed user, uint256 amount, uint256 reward);
    event RewardClaimed(address indexed user, uint256 reward);

    function initialize(address _weedlToken) public initializer {
        require(_weedlToken != address(0), "Zero token address");
        __Ownable_init(msg.sender);
        __UUPSUpgradeable_init();
        __ReentrancyGuard_init();
        weedlToken = IERC20(_weedlToken);
    }

    function _authorizeUpgrade(address newImplementation) internal override onlyOwner {}

    function stake(uint256 _amount, uint256 _duration) external nonReentrant {
        require(_amount > 0, "Amount must be greater than 0");
        require(_duration > 0, "Duration must be greater than 0");

        // Calculate fee (0.420%)
        uint256 fee = (_amount * FEE_BASIS_POINTS) / 10000;
        uint256 totalAmount = _amount + fee;

        // Transfer tokens (including fee) from user to contract
        weedlToken.safeTransferFrom(msg.sender, address(this), totalAmount);

        // Store the stake
        Stake memory newStake = Stake({
            user: msg.sender,
            amount: _amount,
            startTime: block.timestamp,
            duration: _duration,
            rewardDebt: 0,
            isActive: true
        });

        userStakes[msg.sender].push(newStake);
        totalStaked += _amount;

        emit Staked(msg.sender, _amount, _duration, block.timestamp);
    }

    function unstake(uint256 _amount) external nonReentrant {
        require(_amount > 0, "Amount must be greater than 0");

        Stake[] storage userStakeList = userStakes[msg.sender]; // Renamed variable to avoid conflict
        uint256 remainingAmount = _amount;
        uint256 totalReward = 0;

        for (uint256 i = 0; i < userStakeList.length && remainingAmount > 0; i++) {
            if (!userStakeList[i].isActive || userStakeList[i].amount == 0) continue;

            // Check if the stake duration has passed
            require(block.timestamp >= userStakeList[i].startTime + userStakeList[i].duration, "Stake is still locked");

            uint256 stakeAmount = userStakeList[i].amount;
            if (stakeAmount > remainingAmount) {
                // Partial unstake
                userStakeList[i].amount -= remainingAmount;
                totalStaked -= remainingAmount;
                totalReward += calculateReward(remainingAmount, userStakeList[i].duration, userStakeList[i].startTime);
                remainingAmount = 0;
            } else {
                // Full unstake
                userStakeList[i].isActive = false;
                totalStaked -= stakeAmount;
                totalReward += calculateReward(stakeAmount, userStakeList[i].duration, userStakeList[i].startTime);
                remainingAmount -= stakeAmount;
                userStakeList[i].amount = 0;
            }
        }

        require(remainingAmount == 0, "Insufficient staked balance");

        // Transfer staked amount and rewards back to user
        weedlToken.safeTransfer(msg.sender, _amount + totalReward);

        emit Unstaked(msg.sender, _amount, totalReward);
    }

    function claimReward() external nonReentrant {
        Stake[] storage userStakeList = userStakes[msg.sender]; // Renamed variable to avoid conflict
        uint256 totalReward = 0;

        for (uint256 i = 0; i < userStakeList.length; i++) {
            if (!userStakeList[i].isActive || userStakeList[i].amount == 0) continue;

            // Check if the stake duration has passed
            if (block.timestamp >= userStakeList[i].startTime + userStakeList[i].duration) {
                uint256 reward = calculateReward(userStakeList[i].amount, userStakeList[i].duration, userStakeList[i].startTime);
                totalReward += reward;
                userStakeList[i].rewardDebt += reward;
            }
        }

        require(totalReward > 0, "No rewards to claim");

        // Transfer rewards to user
        weedlToken.safeTransfer(msg.sender, totalReward);

        emit RewardClaimed(msg.sender, totalReward);
    }

    function getUserStakes(address _user) external view returns (Stake[] memory) {
        return userStakes[_user];
    }

    function calculateReward(uint256 _amount, uint256 _duration, uint256 _startTime) private view returns (uint256) {
        uint256 timeElapsed = block.timestamp - _startTime;
        if (timeElapsed > _duration) {
            timeElapsed = _duration;
        }
        // Reward = amount * (REWARD_RATE / 10000) * (timeElapsed / SECONDS_PER_YEAR)
        return (_amount * REWARD_RATE * timeElapsed) / (10000 * SECONDS_PER_YEAR);
    }

    function getTotalStaked() external view returns (uint256) {
        return totalStaked;
    }

    function stakes(address _user) external view returns (Stake memory) {
        Stake[] storage userStakesArray = userStakes[_user];
        for (uint256 i = 0; i < userStakesArray.length; i++) {
            if (userStakesArray[i].isActive && userStakesArray[i].amount > 0) {
                return userStakesArray[i];
            }
        }
        return Stake(address(0), 0, 0, 0, 0, false);
    }
}

